# 3_M_Longest Substring Without Repeating Characters
# Created by xc 28/03/2017
"""
    题目要求:找到字符串里最长的不重复的子串
    优化处理
    例如:
    ak..m...bm
    当前的开头元素(外层循环)是a,然后到了第二个m的时候重复了,按照之前的思路,是继续从k开始找的
    但是a-m这些元素,无论你怎么找,都不会比ab更长了(因为都会和m撞上)
    所以a元素的下一位,应当是从第一个m的后面一个元素查找的,am之间的元素都不用查了

    所以修正算法为:current_set,即当前已经遍历过得数字,记录下标
    效率还是低了
    处理不了类似于 abcdabcdabcd这样的情况,每次还是当前元素往后记录


"""
import copy
import time
class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        max_length = 0
        max_substring = []
        current_substring = []
        current_set = {}
        for i in range(0, len(s)):
            # 清空
            current_set = {}
            current_substring = []
            # 放置初始元素
            letter = s[i]
            current_substring.append(letter)
            current_set[letter] = i
            for j in range(i + 1, len(s)):
                if s[j] in current_set:
                    # 遇到重复的字符了,判断当前长度是否大于最大长度,如果是,则更新
                    if len(current_substring) > max_length:
                        max_length = len(current_substring)
                        max_substring = copy.deepcopy(current_substring)
                    # 优化部分 i 从重复的元素开始查找
                    i = current_set[s[j]]
                    # print i
                    break
                else:
                    # 当前字符还未重复过
                    current_substring.append(s[j])
                    current_set[s[j]] = j
            # 直到最后也没重复 这里是边界条件
            if len(current_substring) > max_length:
                max_length = len(current_substring)
                max_substring = copy.deepcopy(current_substring)

        # 拼接
        result = ''.join(max_substring)
        #print result
        return max_length

